import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [items, setItem] = useState({items: []});

  useEffect(() => {
    fetch('https://localhost:3000/')
      .then(res => res.json())
      .then(item => setItem(item));
  });

  return (
    <div className="App">
      <p>bonjour</p>
      {items.map(i => <p>{i.title}</p>)}
    </div>
  );
}

export default App;
